import React from 'react'

import { Image } from "@chakra-ui/image";
import { Stack, Circle, Flex, Box, Text, Heading} from "@chakra-ui/layout";
import { useMediaQuery } from "@chakra-ui/media-query";
import { useColorMode, useColorModeValue} from "@chakra-ui/color-mode";
import { Divider } from "@chakra-ui/react"
import {
    Accordion,
    AccordionItem,
    AccordionButton,
    AccordionPanel,
    AccordionIcon,
  } from "@chakra-ui/react"

import { Grid, GridItem } from "@chakra-ui/react"

const Clients = () => {
    const { colorMode } = useColorMode();
    const isDark = colorMode === "dark";
    const [isNotSmallerScreen] = useMediaQuery("(min-width:600px)");
    return (
        <Stack p = {5} justifyContent = "center" alignSelf = "center" w = "100%">
            <Heading alignSelf = "center"fontWeight="extrabold" color= {isDark?"cyan.300" : "cyan.700"} size="2xl">
                Our Clients
            </Heading>
            <Divider />
          <Grid
            h="200px"
            templateRows="repeat(2, 1fr)"
            templateColumns="repeat(5, 1fr)"
            gap={4}
            >
            <GridItem colSpan={1} bg="tomato">
                <h1>Hello</h1>
            </GridItem>
            <GridItem colSpan={2} bg="papayawhip" />
            <GridItem colSpan={2} bg="papayawhip" />
            <GridItem colSpan={2} bg="tomato" />
            <GridItem colSpan={2} bg="tomato" />
            <GridItem colSpan={1} bg="tomato" />
            <GridItem colSpan={1} bg="tomato" />
            <GridItem colSpan={1} bg="tomato" />
            </Grid>

        </Stack>

    )
}

export default Clients
